<div class="entities" style="line-height: 2.5; direction: ltr">Safety , pharmacokinetics and pharmacodynamics of four-hour intravenous infusions of eritoran in healthy Japanese and Caucasian men . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB04933
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 , a synthetic analogue of lipid A , has been shown to bind to 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    O00206
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 / MD - 2 complex and thereby block the interaction of endotoxins with 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    O00206
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 . We report here the results of a study conducted to assess the single-dose safety and tolerability , as well as the pharmacokinetics and pharmacodynamics , of eritoran infusion in Japanese and Caucasian healthy adult men . Sixty-four men ( aged 20-45 years ; body mass index 18-30 kg / m ( 2 ) ) were randomized into four groups : 4 - mg total dose ( six Japanese and six Caucasian men ) ; 12 - mg total dose ( 12 Japanese and 12 Caucasian men ) ; 28 - mg total dose ( six Japanese and six Caucasian men ) ; and placebo ( eight Japanese and eight Caucasian men ) . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB04933
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 in single doses up to 28 mg over 4 h was well tolerated , with no apparent ethnic differences noted . Plasma concentrations were slightly higher in Japanese versus Caucasian men ; these differences were not significant after adjustment for differences in body mass ( clearance : approximately 1.2 ml / h / kg ; volume of distribution at steady state : approximately 0.07 l / kg ) . The ex vivo endotoxin inhibitory activity of eritoran was similar in Japanese and Caucasian men . The data do not indicate any need for clinical dose adjustment for possible ethnic-based differences in drug distribution or metabolism .</div>

<h2 style="margin: 0">1</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Initial testing of the multitargeted kinase inhibitor pazopanib by the Pediatric Preclinical Testing Program . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB06589
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 is an oral angiogenesis inhibitor targeting vascular growth factor receptor - 1 , - 2 , and - 3 , platelet derived growth factor receptor- , platelet derived growth factor receptor- , and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P10721
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 that has demonstrated activity against a variety of adult cancer xenografts . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB06589
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 was tested against a panel of pediatric rhabdomyosarcoma and Ewing sarcoma xenografts at a dose of 108 mg / kg / day or 100 mg / kg twice daily , administered orally for 28 days . While no objective responses were observed , pazopanib induced statistically significant differences in event-free survival compared to controls in approximately one-half of the sarcoma xenograft models tested . Though well tolerated , pazopanib showed limited activity against the sarcoma models evaluated , with the best tumor responses being growth delay .</div>

<h2 style="margin: 0">14</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">An osteopontin promoter polymorphism is associated with aggressiveness in breast cancer . Metastasis-related genes are deregulated in cancer by aberrant expression or splicing . Here , we analyzed polymorphic sites in the osteopontin promoter as potential contributors to aberrant expression in breast cancers . This study comprised 241 breast cancer specimens , for which DNA from normal surrounding tissue was available for 111 , and 65 healthy breast samples . The polymorphic site in position - 443 of the promoter was associated with tumor grade . As expected , there was no association between promoter single nucleotide polymorphisms ( SNPs ) and tumor stage or in situ carcinoma versus cancer , as stage and early transformation are determined by the sampling time more than by tumor genetics . In a subset of samples , osteopontin RNA expression levels had previously been obtained . The allelic distribution in positions - 443 and - 1748 was distinct between high and low expressors , confirming the importance of promoter SNPs . These two sites also form a haplotype . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P10451
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 expression has been associated with breast cancer progression , regardless of the histological subtype of the cancer . Remarkably , the polymorphic site at - 443 , but not - 1748 or - 1776 , showed differences between ER-positive and ER-negative breast cancers and between PR-positive and PR-negative breast cancers , but there was no association with 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P04626
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 status . In five cases , the genotype of the tumor was different from the genotype of the host , implying the possibility of somatic mutations in the osteopontin promoter that may affect expression . Our results corroborate that the osteopontin promoter SNPs - 443 ( rs11730582 ) and - 1748 ( rs2728127 ) are important for gene expression and breast cancer aggressiveness .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Hypoxic / normoxic preconditioning increases endothelial differentiation potential of human bone marrow CD133 + cells . CD133 + cells are hemangioblasts that have capacity to generate into both hematopoietic and endothelial cells ( ECs ) . Hypoxia / normoxia has shown to be the regulator of the balance between stemness and differentiation . In this study we performed Agilent ' s whole human genome oligo microarray analysis and examined the differentiation potential of the bone-marrow-derived CD133 + cells after hypoxic / normoxic preconditioning of CD133 + cells . Results showed that there was no significant increase in erythroid colony forming unit ( CFU-E ) and CFU-granulocyte , erythrocyte , monocyte , and megakaryocyte formation with cells treated under hypoxia / normoxia . However , a significant increment of EC forming unit at 24 h ( 143.2 + / - 8.0 % ) compared to 0 h ( 100 + / - 11.4 % ) was observed in CFU-EC analysis . Reverse transcription-polymerase chain reaction and immunostaining analysis showed that the differentiated cells diminished hematopoietic stem cell surface markers and acquired the gene markers and functional phenotype of ECs . The transcriptome profile revealed a cluster of 232 downregulated and 498 upregulated genes in cells treated for 24 h under hypoxia . The upregulated genes include angiogenic genes , angiogenic growth factor genes , angiogenic cytokine and chemokine genes , as well as angiogenic-positive regulatory genes , including
